import {useEffect, useState} from 'react'
import Nav from './views/Nav'  
import axios from "axios";
import './App.css';

function App() {

  const [data, setData] = useState([])
  const options = {
    method: 'POST',
    url: 'https://google-ai-vision.p.rapidapi.com/cloudVision/imageCopyrightInfringementDetection',
    headers: {
      'content-type': 'application/json',
      'x-rapidapi-key': 'cc687eba84mshcc7485fcf110baap193a15jsnfb1be463a74d',
      'x-rapidapi-host': 'google-ai-vision.p.rapidapi.com'
    },
    data: {
      source: 'https://images.unsplash.com/photo-1566150905458-1bf1fc113f0d?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2251&q=80',
      sourceType: 'url'
    }
  };

  useEffect(() => {
    axios.request(options).then(function (response) {
      console.log(response.data);
    }).catch(function (error) {
      console.error(error);
    });
  }, [true])


  return (
    <div className="App">
      <Nav data={data}/>
      This is the App
    </div>
  );
}

export default App;
